Біздің қызмет арзан әуе билеттерін бағалайтын саяхатшылар үшін де, жайлы ұшуды қалайтындар үшін де қолайлы. Бағалар сізді таң қалдырады, бірге саяхаттайық!

FlyArystan қосымшасы бұл:
- жолжүкті алдын-ала брондау - 70%-ке дейін үнемдеу;
- орын таңдау;
- рейске тіркелу;
- рейс статусын тексеру;
- тарифтік топтама.



FlyArystan қосымшасының функциялары:
- әуебилеттерді онлайн планшет немесе мобильді құрылғы арқылы сатып алыңыз;
- күндер бойынша жылдам іздеу ұшу күнін таңдау процесін жылдамдатады;
- күнтізбедегі функцияның арқасында сіз қалаған күнге билеттерді жылдам тауып, салыстыра аласыз;
- сіздің бюджетіңізге қарай ұшу кезінде жайлылық деңгейін таңдауға көмектесетін арнайы «тарифтік топтамалар»;
- 3, 6, 12 немесе 24 айға несиеге билет алу мүмкіндігі;
- Қазақстанда сіздің қалаңыздан ұшатын рейстерге әуекомпанияның ең жақсы акциялары мен арнайы ұсыныстарын жіберіп алмауға мүмкіндік беретін push-хабарламалар.



Сіз қай жерде болсаңыз да, брондау туралы растау ала аласыз. Ол пошта арқылы және қолжетімді PDF  форматта  жіберіледі.


Уақытыңыз бен ақшаңызды үнемдеңіз: рейстерге тіркелу тегін, ыңғайлы және жылдам - ​​бірнеше рет басу арқылы.


Мобильді тіркелу қызметі ерекше қажеттіліктері бар жолаушылар үшін де қол жетімді.

Қосымшада сондай-ақ  ваучерлерді пайдалынып жаңа билетті төлеуге немесе қосымша қызметтерді (орын, тамақтану, жолжүк) сатып алу мүмкіндігі бар.


Ұшу билетін сатып алғанда, сенімді болыңыз: Fly Arystan мобильді қосымшасында тек сенімді төлем платформалары қолданылады.


Үлкен саяхаттар қосымшаны жүктеуден басталады.
Fly Arystan қосымшасын дәл қазір жүктеп алыңыз!

Личный кабинет пользователя платных автомобильных дорог создан для предоставления владельцам транспортных средств информационных, аналитических и платежных сервисов касающихся платных автомобильных дорог Республики Казахстан.

Данный сервис предоставляется бесплатно всем владельцам транспортных средств, зарегистрированных в Республике Казахстан.  После прохождения процедуры регистрации,  пользователь может воспользоваться услугами Личного кабинета, который на сегодняшний день предоставляет следующие возможности:

- добавление/удаление транспортных средств (ТС);
- проверка баланса ТС; 
- получение выписок по транспортному средству (ТС), детализация расходов;
- просмотр отчетности пройденного пути по платным автомабильным дорогам;
- пополнение баланса;

Для удобства пользователей реализованы следующие возможности:

Сервис Transcard:
- Оплата за проезд через QR-код с баланса телефона или с банковской карты;
- Поиск маршрутов и отображение передвижения автобусов в режиме онлайн на карте;
- Привязка транспортной карты в личном кабинете пользователя с возможностью проверки и пополнения баланса;
- Прикрепление транспортных карт членов семьи;
- Перевод средств на новую карту и удаленное блокирование транспортной карты в случаях ее утери или поломки;
- Детализация поездок по транспортной карте.

Сервис Velobike.kz:
- Поиск доступных велостанций и отображение на карте;
- Информация о свободных велосипедах на карте;
- Приобретение абонемента;
- Пополнение баланса;
- Отслеживайте информацию о ваших поездах и пополнениях.

Сервис CTS Parking:
- Отображение всех парковочных мест на карте;
- Просмотр список доступных паркингов на карте;
- Онлайн аренда парковочного места;
- Онлайн оплата;
- Продление аренды.

